package hero.amongus.game.enums;

public enum MurderSkin {
  AARON("Aaron", "", ""),
  ALEX("Alex", "", ""),
  BEN("Ben", "", ""),
  BOBBY("Bobby", "", ""),
  BRUCE("Bruce", "", ""),
  CONNOR("Connor", "", ""),
  DANY("Dany", "", ""),
  ELI("Eli", "", ""),
  JOSH("Josh", "", ""),
  NICK("Nick", "", ""),
  ROBYN("Robyn", "", ""),
  SAM("Sam", "", ""),
  SIMONE("Simone", "", ""),
  TANIA("Tania", "", ""),
  TIM("Tim", "", ""),
  VINNY("Vinny", "", "");

  private String name;
  private String value;
  private String signature;

  MurderSkin(String name, String value, String signature) {
    this.name = name;
    this.value = value;
    this.signature = signature;
  }

  public String getName() {
    return this.name;
  }

  public String getValue() {
    return this.value;
  }

  public String getSignature() {
    return this.signature;
  }
}
